import React from 'react';

const Posts=(props)=>
{
    const posts=props.posts;
    const setPosts=props.setPosts;

    return <>{posts.map((post)=>
        {
            return <div>
                <h2>{post.title}</h2>
            </div>
        })}</>
}

export default Posts;
